window.bookSummaryJSON = "<p>He got a fake fiancée to avoid an arranged marriage...except she turns out to be his arranged wife after all.</p> <p>Ambitious, driven and independent, billionaire Huxley Lasker refuses to marry the vapid bride his family has chosen to further their legal dynasty. Instead, he asks Grace Lain, a hot one-night stand from a few weeks earlier, to be his fake fiancée.</p> <p>But Grace turns out to be the arranged wife—and their one-night stand has left her pregnant.</p> <p>The Unwanted Bride is a standalone romance with all the feels and a happy ending!</p>"; 
